import './App.css';

function App() {
  return (
    // Esta es la estructura de componentes de App
    <div className="App">

      <TodoCounter />
      <TodoSearch />

      <TodoList >
        <TodoItem />
        <TodoItem />
        <TodoItem />
      </TodoList>

      <CreateTodoButton/>

    </div>
  );
}




export default App;
